import React from 'react'
import * as Axios from 'axios'
import './location.css';
import './index.css';
import Button from 'react-bootstrap/Button'
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'



class Location extends React.Component {

    constructor(props) {
        super(props);
        this.locate = this.locate.bind(this);
        this.updateStateWithArray = this.updateStateWithArray.bind(this);
        this.renderTheArray = this.renderTheArray.bind(this);
        this.state = ({ latitude: 59.38273599999999, longitude: 17.992799999999992 });
    }


    locate() {

        if (navigator.geolocation) {
            console.log(this);
            navigator.geolocation.getCurrentPosition(this.getGeoLocation);

        }

    }

    render() {

        console.log(this.state.AllPlaceObjects);

        return (
            <div className="calc-row">
                <Container>
                    <Row>
                        <Col></Col>
                        <Col className="border">
                            <h1>ParkHere</h1>
                            <br></br>
                            <div>
                                <Button variant="primary" onClick={this.locate} className="buttonz">Hitta din plats!</Button>
                                <br></br>
                                <br></br>
                            </div>
                            <div>
                                {this.renderTheArray()}
                            </div>
                        </Col>
                        <Col></Col>
                    </Row>
                </Container>
            </div>
        )

    }

    renderTheArray() {

        if (this.state.AllPlaceObjects) {
            if(this.state.AllPlaceObjects.length){
            let tempPlaces = this.state.AllPlaceObjects;
            let arrayWithHTML = [];

            console.log(this.state.AllPlaceObjects);
            console.log(tempPlaces);

            console.log(this.state.AllPlaceObjects.length);

            for (const onePlace of this.state.AllPlaceObjects) {
                arrayWithHTML.push(<div>{onePlace.dateToday} {onePlace.timeToday}<br></br></div>);
                arrayWithHTML.push(<div>Område: {onePlace.district}<br></br></div>);
                arrayWithHTML.push(<div>Address: {onePlace.returnAddress}<br></br></div>);
                arrayWithHTML.push(<div>{onePlace.serviceMessage}<br></br></div>);
                arrayWithHTML.push(<div>{onePlace.maxHours}<br></br><br></br></div>);


                console.log(onePlace);
            }

            console.log(arrayWithHTML[0]);
            return (
                <React.Fragment>
                    <span><strong>Här gäller följande parkeringsregler: <br></br><br></br></strong></span>
                    {arrayWithHTML}
                </React.Fragment>
            ) 
          } else {
            return (
              <React.Fragment>
                  <span><strong>Vi hittade inga parkeringar i närheten av din position<br></br><br></br></strong></span>
              </React.Fragment> )
          }
        } else {
            return (
                <React.Fragment>
                    <span>Tryck på knappen för att se om du kan parkera här.</span>
                </React.Fragment>)
        }
    }


    getGeoLocation = (position) => {

        let setArray = this.updateStateWithArray;

        const array = [];
        Axios.get(`http://localhost:8080/location?lat=${position.coords.latitude}&lng=${position.coords.longitude}`
        )
            .then(function (response) {
                console.log("response data: " + response.data);
                for (const property of response.data) { //om response.data är en array
                    array.push(property);
                    console.log(property);
                    //detta pushar in alla dataobject i data arrayen.
                }
                console.log('här kommer en array');
                console.log(JSON.stringify(array));
                setArray(array);
            })
            .catch(function (error) {
                console.log(error);
            });

    }

    updateStateWithArray(array) {
        this.setState({ AllPlaceObjects: array });
    }
}

export default Location
